window.bookSummaryJSON = "<p><b>Book three in the gripping supernatural series by the best-selling author of the Chronicles of St Mary's series.</b></p> <p><i>I don't know who I am. I don't know what I am.</i></p> <p>The identity of Elizabeth Cage has always been a mystery. Even she doesn't know who, or what, she is. But she's learned to live with it.</p> <p>Until now, when what should have been a peaceful holiday turns into anything but, and Elizabeth is forced to recognise that she isn't what she seems.</p> <p>But neither is anyone else. Has her whole life been a lie?</p> <p>Someone very badly wants to know the truth about Elizabeth Cage. And they'll do anything to find out. But who will live to regret it?</p> <p>Twisty, dark and incredibly gripping, the Elizabeth Cage novels are perfect for fans of Sarah Painter and Genevieve Cogman.</p>"; 
